import React from 'react';
import propTypes from "prop-types"
import classNames from 'classnames';
import { Time, IconReaded } from 'components';

import "./Message.scss"

const Message = ({
    avatar,
    user,
    text,
    date,
    audio,
    isMe,
    isReaded,
    attachments,
    isTyping
}) => {
    return <div className={classNames('message', {
        'message--isme': isMe,
        "message--is-typing": isTyping,
        "message--image": attachments && attachments.length === 1,
        "message--is-audio": audio
    })}
    >
        <div className='message__content'>
            <IconReaded isMe={isMe} isReaded={isReaded}></IconReaded>
            <div className='message__avatar'>
                <img src={avatar} alt={`User ${user/* .fullname */}`} />
            </div>
            <div className='message__info'>
                <div>
                    {(audio || text || isTyping) && <div className='message__bubble'>
                        {text && <p className='message__text'>{text}</p>}
                        {isTyping && <div className='message__typing'>
                            <span></span>
                            <span></span>
                            <span></span>
                        </div>}
                        <p>dqwdqwd</p>
                    </div>}
                    {attachments && (
                        <div className='message__attachments'>
                            {attachments.map(item => (
                                <div className='message__attachments-item'>
                                    <img src={item.url} alt={item.filename} />
                                </div>
                            ))}
                        </div>
                    )}
                    {date && <span className='message__date'>
                        <Time date={date}></Time>
                    </span>}
                </div>

            </div>
        </div>
    </div>
}

const Message1 = ({
    avatar,
    user,
    text,
    date,
    isMe,
    isReaded,
    attachments,
    isTyping
}) => {
    return <div className={classNames('message', {
        'message--isme': isMe,
        "message--is-typing": isTyping,
        "message--image": attachments && attachments.length === 1
    })}
    >
        <div className='message__content'>
            <IconReaded isMe={isMe} isReaded={isReaded}></IconReaded>
            <div className='message__avatar'>
                <img src={avatar} alt={`User ${user/* .fullname */}`} />
            </div>
            <div className='message__info'>
                <div>
                    {(text || isTyping) && <div className='message__bubble'>
                        {text && <p className='message__text'>{text}</p>}
                        {isTyping && <div className='message__typing'>
                            <span></span>
                            <span></span>
                            <span></span>
                        </div>}
                    </div>}
                    <div className='message__attachments'>
                        {attachments &&
                            attachments.map(item => (
                                <div className='message__attachments-item'>
                                    <img src={item.url} alt={item.filename} />
                                </div>
                            ))}
                    </div>
                    {date && <span className='message__date'>
                        <Time date={date}></Time>
                    </span>}
                </div>

            </div>
        </div>
    </div>
}

Message.defaultProps = {
    user: {}
}

Message.propTypes = {
    avatar: propTypes.string,
    user: propTypes.string,
    text: propTypes.string,
    date: propTypes.object,
    attachments: propTypes.array,
    isTyping: propTypes.bool,
    isMe: propTypes.bool,
    isReaded: propTypes.bool,
    audio: propTypes.string
}

export default Message;
